import React, { Component } from 'react'
import LayoutCustomerTestimonial from './components/LayoutCustomerTestimonial.jsx';
import LayoutTemplateHeader from './components/LayoutTemplateHeader.jsx'
import LayoutTemplateBanner from './components/LayoutTemplateBanner.jsx'
import LayoutTemplateFooter from './components/LayoutTemplateFooter.jsx'
import LayoutTemplateIntroduce from './components/LayoutTemplateIntroduce.jsx'
import LayoutTemplateServices from './components/LayoutTemplateServices.jsx'
import './App.css';

export default class App extends Component {

    constructor(props) {
        super(props);
        this.state = {
            testimonials: []
        }
    }

    render() {
        return (
            <div id="wrapper">
                <LayoutTemplateHeader />
                <LayoutTemplateBanner />
                <main id="main" class="site-main haslayout">
                    <div class="fw-page-builder-content">
                        <section class="tg-main-section haslayout" style={{ backgroundColor: "#f7f7f7", backgroundRepeat: "no-repeat", backgroundPosition: "0% 100%", backgroundSize: "cover", display: "flex" }}  >
                            <div class="container" style={{ paddingRight: "5px", paddingLeft: "5px", marginRight: "0", marginLeft: "0", display:"flex", width:"100%"}}>
                                <LayoutTemplateIntroduce/>
                                <div style={{width:"48%", height:"100%"}}>
                                    <LayoutCustomerTestimonial primaryColor={"rgb(147,0,80)"}/>
                                </div>
                            </div>
                        </section>
                        <section class="tg-main-section haslayout" style={{ backgroundColor: "#f7f7f7", backgroundRepeat: "no-repeat", backgroundPosition: "0% 100%", backgroundSize: "cover", padding: "0 0 100px 0" }}>
                            <LayoutTemplateServices />
                        </section>
                    </div>
                </main>
                <LayoutTemplateFooter/>
            </div>
        );
    }
}
